import { usestate } from "react";

function Car() {
  let [color, setstate] = usestate("blue");
  return (
    <>
      <h1>I Am {color} FarrariCar</h1>
      <button onClick={() => setstate("Red")}>Change color</button>
    </>
  );
}
export default Car;
